import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Alucentra Consulting</h1>
        <p>
          Illuminating transformation through clarity, insight, and operational excellence.
        </p>
        <p>
          We specialize in Strategy & Transformation, Process Design, and Change Management.
        </p>
        <a
          className="App-link"
          href="mailto:info@alucentra.com"
        >
          Contact Us
        </a>
      </header>
    </div>
  );
}

export default App;
